      <div >
         {data.map((users) => {
            return (
               (users.role === 'user' ?
                  <UserItem name={users.name} />
                  : ''
               )
            )
         })}
         <AverageAge average={average()} />
         <button onClick={test}>test</button>
      </div>)
}

export default UserList
